    const dispatch= useDispatch();

    useEffect(() =>{
        dispatch(props.match.params.id)
    })

    const detail= useSelector(state=> state.detail);

    return(
        <div>
            <h1>Detail</h1>
        </div>
    )
}

export default Detail;

